package Model;

public class F2 {
	private A a;
	private B b1;
	private B b2;
	private C c;
	public F2() {
		super();
		// TODO Auto-generated constructor stub
	}
	public F2(A a, B b1, B b2, C c) {
		super();
		this.a = a;
		this.b1 = b1;
		this.b2 = b2;
		this.c = c;
	}
	public A getA() {
		return a;
	}
	public void setA(A a) {
		this.a = a;
	}
	public B getB1() {
		return b1;
	}
	public void setB1(B b1) {
		this.b1 = b1;
	}
	public B getB2() {
		return b2;
	}
	public void setB2(B b2) {
		this.b2 = b2;
	}
	public C getC() {
		return c;
	}
	public void setC(C c) {
		this.c = c;
	}
	
	

}